                </a>
            </div>
            <div className='header--user'>
                <a href="/">
                    <img src="https://i.pinimg.com/originals/d8/70/20/d87020c70b0bf5eec4918874fa7d0f9f.jpg" alt="Usuario" />
                </a>
            </div>
        </header>
    )
}
